if (context.expand( '${Display current product#res_quantity}' ).toString() == ""){
	return 2;
}
else{
	def quantity = context.expand( '${Display current product#res_quantity}' ).toInteger();
	return (quantity + 2);
}

if (context.expand( '${Display current product#res_quantity}' ).toString() == ""){
	def quantity2 = context.expand( '${Add non serialized product item to sales bi#req_quantity}' ).toInteger();
	def quantity3 = context.expand( '${Add another sales item for nonserialized product#req_quantity}' ).toInteger();
	return (quantity2 + quantity3);
}
else{
	def quantity1 = context.expand( '${Display current product#res_quantity}' ).toInteger();
	def quantity2 = context.expand( '${Add non serialized product item to sales bi#req_quantity}' ).toInteger();
	def quantity3 = context.expand( '${Add another sales item for nonserialized product#req_quantity}' ).toInteger();
	return (quantity1 + quantity2 + quantity3);
}

